import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import { Link } from "react-router-dom";
import GitHubIcon from "@mui/icons-material/GitHub";
import LinkedInIcon from "@mui/icons-material/LinkedIn";

function AboutMe() {
  return (
    <>
      <Avatar
        alt="Me!"
        sx={{ width: 200, height: 200, margin: "auto", marginTop: "8%" }}
        src="https://res.cloudinary.com/dorg7gesr/image/upload/v1713168349/iyshxeowceen6kpqvf8h.jpg"
      />
      <div class="section_text">
        <p class="section_text_p1"> Hello, I'm</p>
        <h1 class="title">Ryan Tang</h1>
        <div class="btn-container">
          <Button
            variant="contained"
            sx={{ borderRadius: 10, backgroundColor: "#3F72AF" }}
          >
            Contact Info
          </Button>
        </div>
        <div id="socials-container">
          <a href="www.linkedin.com/in/ryantangmj">
            <LinkedInIcon
              sx={{ fontSize: 40, color: "#3F72AF", mt: 1, p: 0.5 }}
            />
          </a>
          <GitHubIcon sx={{ fontSize: 40, color: "#3F72AF", mt: 1, p: 0.5 }} />
        </div>
      </div>
    </>
  );
}

export default AboutMe;
